import logo from './logo.svg';
import './App.css';
import HomePage from './pages/HomePage';
import About from './pages/About';
import Contact from './pages/Contact';
import { BrowserRouter as Router,Route,Switch} from 'react-router-dom';

function App() {
  return (
    <Router>
      <div>
        <Switch>

          <Route exact path='/'>
            <HomePage/>
          </Route>

          <Route path='/About'>
            <About/>
          </Route>

          <Route path='/Contact'>
            <Contact/>
          </Route>

        </Switch>
      </div>
    </Router>

  );
}

export default App;
